.time()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.time() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1512","type":"AdaptiveTicker"},{"attributes":{},"id":"1042","type":"DataRange1d"},{"attributes":{},"id":"1008","type":"LinearScale"},{"attributes":{"tools":[{"id":"1300"},{"id":"1301"},{"id":"1302"}]},"id":"1303","type":"Toolbar"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_interval":1800000.0,"min_interval":1000.0,"num_minor_ticks":0},"id":"1551","type":"AdaptiveTicker"},{"attributes":{"line_alpha":0.2,"line_color":"blue","x":{"field":"time"},"y":{"field":"write_bytes"}},"id":"1339","type":"Line"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1550","type":"AdaptiveTicker"},{"attributes":{},"id":"1480","type":"AllLabels"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"1528","type":"AdaptiveTicker"},{"attributes":{"coordinates":null,"group":null,"text":"Number of File Descriptors"},"id":"1369","type":"Title"},{"attributes":{"dimensions":"width"},"id":"1022","type":"WheelZoomTool"},{"attributes":{"axis":{"id":"1378"},"coordinates":null,"group":null,"ticker":null},"id":"1381","type":"Grid"},{"attributes":{"tools":[{"id":"1267"},{"id":"1268"},{"id":"1269"}]},"id":"1270","type":"Toolbar"},{"attribu
